eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   \"biographyEN\": () => (/* binding */ biographyEN),\n/* harmony export */   \"biographyPL\": () => (/* binding */ biographyPL)\n/* harmony export */ });\nconst biographyEN = [\n    `Antonio Garca Mulet: Fullness of Life, Art as a Reflection of Existence`,\n    `Antonio Garca Mulet, an artist born on November 17, 1932 in Barcelona, is an extraordinary figure in the history of contemporary art. His biography, complex and full of fascinating stages, is like an open book whose pages illustrate not only his artistic evolution, but also his deep philosophy of life. Mulet's works not only reflect his personal reflections, but also contain delicate comments on contemporary times, which makes him an extremely inspiring artist. His work occupies an honorable place in the history of art, offering viewers a multidimensional perspective on reality and inspiring deeper considerations on various aspects of social life, culture and history.`,\n    `Early Years and Education:`,\n    `Mulet entered the world of art almost from the moment he was born, listening to his family's stories about great artistic traditions. Already as a young boy, he showed artistic talents, which resulted in the decision to study art. Graduating from the \"Flechas Navales\" art school in his mother's hometown - Palma de Mallorca, was only a prelude to his education, which he continued, inspired by the greatest artists he had the pleasure of meeting. In 1949, after moving to Algeria, he began a fascinating journey through the world of space and architecture, in the company of architects from different parts of the world, especially Jean-Jaqus Deluz, which had a significant impact on his work and allowed him to express an original view of the world in his works. .`,\n    `Family:`,\n    `In 1956, Antonio Garca Mulet married Minerva Leon, creating a happy family. The couple had two children: a daughter Elena, also known as Lya, born on June 17, 1957, and a son Antonio, born on June 1, 1960. Their family was an important source of support and inspiration for the artist.`,\n    `Evolution of Creativity:`,\n    `At the age of 30, Antonio Garca Mulet made a bold decision to move to Paris, which was a breakthrough moment in his artistic life, as he initiated his fascinating adventure with painting. For Mulet, the capital of European art was a period of intense discovery of various artistic trends. It was there that he began to develop his individual style, listening to both tradition and modern artistic expression. There he became an integral part of the local art scene of the era. His work drew inspiration from the achievements of such great artists as Juan Mir and Antonio Saura. In the Abstract Expressionism movement, he found his own unique way to express his unique creativity. His works exuded expression, richness of colors and gestures, which enabled him to convey deep emotions and thoughts through abstract forms.`,\n    `Painting debut:`,\n    `As an experienced painter, Antonio Garca Mulet debuted at his first exhibition in 1970 in Paris, which marked a significant moment in his artistic career. This event not only gained recognition in the art world, but also opened the door to the fascinating circle of the Dada movement. In this environment he developed close contacts with many other artists of the time, and one of his special friends and admirers of his work was Ren Char. Ren Char, a respected poet and philosopher, introduced Garca Muleta to the Dadaist artistic movement, which allowed him to deepen his understanding of art. It was in this context that he came into direct contact with other great artists, including Juan Mir. Mir showed particular interest in Mulet's work and dedicated to him the words in the book \"Collection d'art UNESCO 10-18\" dated August 5, 1968: \"Para Mulet animadole para que se lance a fondo\", which can be translated as \"For Mulet - I urge you to devote yourself to it endlessly.\" This dedication was a unique recognition and encouragement to pursue one's artistic passion, and at the same time embodied the spirit of friendship and support in the artistic circles of Paris at that time.`,\n    `Popularity in Europe:`,\n    `In the 1970s, thanks to Michael Tapi - a renowned art critic, Mulet had the opportunity to present his unique talent and art to a wider audience in Spain through an exhibition at the prestigious Ynganzo gallery in Madrid. This exhibition enabled the artist to exhibit his works in an environment that appreciated his work and created a favorable ground for its further development on the Spanish art scene.`,\n    `Antonio Garca Mulet has been generously recognized by an international association of artists, curators, critics and collectors, receiving the prestigious Morgan Prize in 1972 at the Ravenna Biennale, Italy. This unique distinction during such a prestigious event was the culminating moment in his artistic career, as well as proof of the huge impact he had on the world of art. This award not only honored Mulet, but also highlighted his significant contributions to the development of abstract art and abstract expressionism on an international scale. Thanks to this appreciation, the artist could enjoy recognition on the international arena, which significantly influenced the further development of his work and position on the world art scene.`,\n    `In 1973, an album titled \"MIRO 80\" was released, a tribute to the outstanding artist Juan Mir on the occasion of his 80th birthday. Antonio Garca Mulet had the honor of being part of this unique project, where, together with other renowned artists from the world stage, they paid tribute to Mir. As part of this album, Mulet shared his work titled \"Ecce Homo\", which is an acrylic painting on canvas measuring 132 x 91 centimeters. This event was not only an opportunity to honor Mir's achievements, but also to combine the talents of many artists who expressed their respect for the work of this great master of art. The album \"MIRO 80\" has become a unique document of artistic dialogue and tribute to one of the most important artists of the 20th century.`,\n    `25th anniversary of artistic work:`,\n    `As a recognized and respected artist, Antonio Garca Mulet had the honor to celebrate the 25th anniversary of his fruitful artistic activity at the prestigious Center for Contemporary Art in Noyers sur Serein - Yonne. This event was not only an opportunity to reflect on his long and creative career, but also an opportunity to express thanks for the support and recognition from the art world. It was a unique moment when the artist could share his achievements with a wide audience and continue his fascinating artistic journey that enriched the heritage of contemporary art.`,\n    `Symbolism as the Language of Art:`,\n    `In Mulet's works we find a wealth of signs and symbols that form complex compositions. It is like a hidden language that the artist uses to tell a story about human existence, contemporary problems and the joys of life. Each element has a deeper meaning, which makes Mulet's paintings an interactive journey for the viewer.`,\n    `As a graffiti enthusiast and devoted lover of urban art, he found incredible inspiration in an unconventional source - the silhouette of Mickey Mouse, which could often be seen on the walls of various city buildings. This unusual source inspired him to create his own, unique styling of this character, which became a symbol of his work. It was much more than a simple sign; it was an artistic message that combined transience with significance, suggesting a new way of interpretation. Mulet not only retained the characteristic features of the original character, but also gave them a completely new meaning, which made this artistic signature an inseparable element of his works and left a lasting mark in the world of urban art, fascinating viewers with its originality and creativity.`,\n    `Life as Inspiration:`,\n    `Antonio Garca Mulet, through his work and activity in the artistic community, influenced the shaping of contemporary art. His works decorate the most important galleries in the world, and his unique style inspires subsequent generations of artists to seek their own expression and a bold approach to art. Apart from art, Mulet is also passionate about life. His travels, meetings with other artists and personal experiences are a constant source of inspiration. The artist is constantly looking for new challenges and forms of expression, unafraid to enter the unknown.`,\n    `Currently:`,\n    `In 2000, Antonio Garca Mulet made a decisive decision to return to his hometown of Majorca, which was an important stage in his life and artistic career. This symbolic return to his place of birth and roots had a significant impact on his work, inspiring him with new perspectives and places to express himself artistically. Since then, the artist has continued his creative activity and actively engaged in the local and international artistic environment, constantly expanding the horizons of his art. Currently, Antonio Garca Mulet, together with the renowned Polish artist and friend, Waldemar Kondratowski, is involved in creating a joint artistic project. This artistic collaboration symbolizes their synergistic work, where both artists join forces to create new and fascinating works of art.`,\n    `Antonio Garca Mulet, distinguished by his unique personality and positive approach to life, managed to gain a wide group of devoted admirers. His openness to new experiences and a deep desire to pass on his artistic vision to future generations led him to create a work called \"Rainbow\". This work becomes a manifesto of his ideas of tolerance and equality, constituting a unique contribution to the developing cultural and artistic discourse of the 21st century. The joint project with Mirella Kurek, who is his friend and supporter, turned out to be not only an artistic challenge, but above all a strong bond between their two individuals. Mirella Kurek became an active promoter of Garca Muleta's work, which allowed her to reach an even wider audience and convey her artistic message. This artistic partnership, born out of a passion for art and a shared commitment to promoting values such as tolerance and equality, has significantly influenced Garca Muleta's developing work, proving that art can act not only as an artistic expression, but also as a transmitter of important messages that shape our reality.`,\n    `The life of Antonio Garca Muleta is like a painting whose every dot and brushstroke is an integral part of a deeper story. His raw expression, rich symbolism and view of modernity made him not only an outstanding artist, but also a philosopher of art. His legacy will continue for generations to come, inspiring reflection and the search for deeper meaning in art and life. Antonio Garca Mulet is not only a painter, he is a mystic whose works become a call to discover unknown areas of art and the human soul.`\n];\nconst biographyPL = [\n    `Antonio Garca Mulet: Penia ycia, Sztuka jako Refleksja Egzystencji`,\n    `Antonio Garca Mulet, artysta urodzony 17 listopada 1932 roku w Barcelonie, stanowi niezwyk posta w historii sztuki wspczesnej. Jego yciorys, zoony i peen fascynujcych etapw, jest jak otwarta ksiga, ktrej strony ilustruj nie tylko artystyczn ewolucj, ale take gbok filozofi ycia. Dziea Muleta nie tylko odzwierciedlaj jego osobiste refleksje, lecz take zawieraj delikatne komentarze dotyczce wspczesnoci, co czyni go niezwykle inspirujcym artyst. Jego twrczo zajmuje zaszczytne miejsce w historii sztuki, oferujc widzom wielowymiarow perspektyw na rzeczywisto i inspirujc do gbszych rozwaa nad rnorodnymi aspektami ycia spoecznego, kultury i historii.`,\n    `Wczesne Lata i Edukacja:`,\n    `Mulet wchodzi w wiat sztuki niemale od chwili narodzin, zasuchany w opowieci rodziny o wielkich tradycjach artystycznych. Ju jako mody chopiec okazywa zdolnoci artystyczne, ktre zaowocoway decyzj o podjciu studiw artystycznych. Ukoczenie szkoy artystycznej Flechas Navales w rodzinnym miecie swojej mamy - Palma de Mallorca to jedynie preludium do jego edukacji, ktr kontynuowa inspirujc si najwikszymi artystami, ktrych mia przyjemno spotka. W 1949 roku po przeprowadzce do Algierii  rozpocza si jego fascynujca podr  przez wiat przestrzeni i architektury, w towarzystwie architektw z rnych stron wiata, szczeglnie Jean-Jaqusem Deluz, ktra miaa znaczcy wpyw na jego twrczo i pozwolia mu wyrazi oryginalne spojrzenie na wiat w swoich dzieach.`,\n    `Rodzina:`,\n    `W roku 1956 Antonio Garca Mulet polubi Minerv Leon, tworzc szczliw rodzin. Para miaa dwjk dzieci: crk Elen, znan rwnie jako Lya, urodzon 17 czerwca 1957 roku, oraz syna Antonio, ktry przyszed na wiat 1 czerwca 1960 roku. Ich rodzina bya wanym rdem wsparcia i inspiracji dla artysty.:`,\n    `Ewolucja Twrczoci:`,\n    `Majc 30 lat, Antonio Garca Mulet podj odwan decyzj o przeprowadzce do Parya, co stanowio przeomowy moment w jego yciu artystycznym, zainicjowa bowiem swoj fascynujc przygod z malarstwem. W stolicy sztuki europejskiej byy dla Muleta okresem intensywnego odkrywania rnorodnych nurtw artystycznych. To tam zacz rozwija swj indywidualny styl, zasuchujc si zarwno w tradycj, jak i w nowoczesne wyraenie artystyczne. Sta si tam integraln czci tamtejszej sceny artystycznej epoki. Jego twrczo czerpaa inspiracj z dorobku takich wielkich artystw jak Juan Mir i Antonio Saura. W ruchu ekspresjonizmu abstrakcyjnego odnalaz on wasny, niepowtarzalny sposb na wyraenie swojej wyjtkowej kreatywnoci. Jego dziea emanoway ekspresj, bogactwem kolorw i gestw, co umoliwio mu przekazywanie gbokich emocji i myli za pomoc abstrakcyjnych form.`,\n    `Debiut Malarski:`,\n    `Jako dowiadczony malarz, Antonio Garca Mulet zadebiutowa na swojej pierwszej wystawie w 1970 roku w Paryu, co stanowio znaczcy moment w jego karierze artystycznej. To wydarzenie nie tylko zyskao uznanie w wiecie sztuki, ale rwnie otworzyo mu drzwi do fascynujcego krgu ruchu dadaistycznego. W tym rodowisku nawiza bliskie kontakty z wieloma innymi artystami tamtych czasw, a jednym z jego wyjtkowych przyjaci i wielbicieli jego twrczoci by Ren Char. Ren Char, ceniony poeta i filozof, wprowadzi Garc Muleta w krgi dadaistycznego ruchu artystycznego, co pozwolio mu na pogbienie swojego zrozumienia sztuki. To wanie w tym kontekcie nawiza bezporedni kontakt z innymi wielkimi artystami, w tym Juanem Mir. Mir okaza szczeglne zainteresowanie twrczoci Muleta i dedykowa mu sowa w ksice Collection d'art UNESCO 10-18 datowane na 5 sierpnia 1968 roku: \"Para Mulet animadole para que se lance a fondo\", co mona przetumaczy jako \"Dla Muleta - namawiam Ci, aby odda si temu bez koca\". Ta dedykacja stanowia wyjtkowe uznanie i zacht do kontynuowania artystycznej pasji, a jednoczenie uosabiaa ducha przyjani i wsparcia w krgach artystycznych Parya tamtych czasw.`,\n    `Popularno w Europie:`,\n    `W latach 70., dziki Michael Tapi - uznanemu krytykowi sztuki,  Mulet mia moliwo zaprezentowania swojego unikalnego talentu i sztuki szerszej publicznoci w Hiszpanii poprzez wystaw w prestiowej galerii Ynganzo w Madrycie. Ta ekspozycja umoliwia artycie eksponowanie swoich dzie w rodowisku, ktre docenio jego twrczo i stworzyo dogodny grunt dla jej dalszego rozwoju na hiszpaskiej scenie artystycznej.`,\n    `Antonio Garca Mulet zosta hojnie doceniony przez midzynarodowe stowarzyszenie artystw, kuratorw, krytykw i kolekcjonerw, otrzymujc w 1972 roku prestiow Nagrod Morgana na Biennale w Rawennie, Wochy. To wyjtkowe wyrnienie podczas tak prestiowej imprezy bya kulminacyjnym momentem w jego karierze artystycznej, a take dowodem na ogromny wpyw, jaki wywar na wiat sztuki. Nagroda ta nie tylko uhonorowaa Muleta, ale take podkrelia jego znaczcy wkad w rozwijanie sztuki abstrakcyjnej i ekspresjonizmu abstrakcyjnego na skal midzynarodow. Dziki temu docenieniu artysta mg cieszy si uznaniem na arenie midzynarodowej, co znaczco wpyno na dalszy rozwj jego twrczoci oraz pozycj na wiatowej scenie artystycznej.`,\n    `W 1973 roku ukaza si album zatytuowany \"MIRO 80\", bdcy wyrazem hodu dla wybitnego artysty Juana Mir z okazji jego 80. urodzin. Antonio Garca Mulet mia zaszczyt by czci tego wyjtkowego projektu, gdzie wsplnie z innymi uznawanymi artystami ze sceny wiatowej oddali hod Mir. W ramach tego albumu, Mulet udostpni swoje dzieo zatytuowane \"Ecce Homo\", bdce akrylowym obrazem na ptnie o wymiarach 132 x 91 centymetrw. To wydarzenie byo nie tylko okazj do uhonorowania dorobku Mir, ale take poczeniem talentw wielu artystw, ktrzy wyrazili swoje szacunek wobec twrczoci tego wielkiego mistrza sztuki. Album \"MIRO 80\" sta si wyjtkowym dokumentem artystycznego dialogu i hodu skierowanego ku jednemu z najwaniejszych artystw XX wieku.`,\n    `25-lecie pracy artystycznej:`,\n    `Jako uznany i ceniony artysta, Antonio Garca Mulet mia zaszczyt uczci 25. rocznic swojej owocnej dziaalnoci artystycznej w prestiowym Centrum Sztuki Wspczesnej w Noyers sur Serein - Yonne. To wydarzenie stanowio nie tylko okazj do refleksji nad jego dug i twrcz karier, ale take bya okazj do podzikowania za wsparcie i uznanie ze strony wiata sztuki. To by wyjtkowy moment, kiedy artysta mg podzieli si swoim dorobkiem z szerok publicznoci i kontynuowa swoj fascynujc podr artystyczn, ktra wzbogacaa dziedzictwo sztuki wspczesnej.`,\n    `Symbolika jako Jzyk Sztuki:`,\n    `W dzieach Muleta odnajdujemy bogactwo znakw i symboli, ktre ukadaj si w zoone kompozycje. To jakby ukryty jzyk, ktry artysta uywa do opowiedzenia historii o ludzkiej egzystencji, wspczesnych problemach i radociach ycia. Kady element ma gbsze znaczenie, co sprawia, e obrazy Muleta staj si interaktywn podr dla widza.`,\n    `Jako entuzjasta graffiti i oddany mionik sztuki miejskiej, znalaz niesamowit inspiracj w niekonwencjonalnym rdle - sylwetce Myszki Miki, ktr czsto mona byo spotka na murach rnych budynkw miejskich. To nietypowe rdo zainspirowao go do stworzenia wasnej, unikalnej stylizacji tej postaci, ktra staa si symbolem jego twrczoci. To byo co znacznie wicej ni prosty znak; by to przekaz artystyczny, ktry czy w sobie ulotno z istotnoci, sugerujc nowy sposb interpretacji. Mulet nie tylko zachowa charakterystyczne cechy oryginalnej postaci, ale take nada im zupenie nowe znaczenie, co uczynio t artystyczn sygnatur nieodcznym elementem jego dzie i pozostawio trway lad w wiecie sztuki miejskiej, fascynujc widzw swoj oryginalnoci i kreatywnoci.`,\n    `ycie jako Inspiracja:`,\n    `Antonio Garca Mulet, poprzez swoj twrczo i aktywno w rodowisku artystycznym, wpyn na ksztatowanie wspczesnej sztuki. Jego prace zdobi najwaniejsze galerie wiata, a jego unikalny styl inspiruje kolejne pokolenia artystw do poszukiwania wasnego wyrazu i odwanego podejcia do sztuki. Poza sztuk, Mulet jest rwnie pasjonatem ycia. Jego podre, spotkania z innymi artystami i dowiadczenia osobiste stanowi nieustajce rdo inspiracji. Artysta nieustannie poszukuje nowych wyzwa i form wyrazu, nie bojc si wchodzi w nieznane.`,\n    `Obecnie:`,\n    `W roku 2000, Antonio Garca Mulet podj zdecydowan decyzj o powrocie w rodzinne strony na Majork, co stanowio istotny etap w jego yciu i karierze artystycznej. To symboliczne wrcenie do swojego miejsca urodzenia i korzeni miao znaczcy wpyw na jego twrczo, inspirujc go nowymi perspektywami i miejscami do wyraenia siebie artystycznie. Od tamtego czasu, artysta kontynuowa swoj aktywno twrcz, a take wczy si aktywnie w lokalne i midzynarodowe rodowisko artystyczne, stale poszerzajc horyzonty swojej sztuki. W obecnej chwili, Antonio Garca Mulet wsplnie z uznawanym polskim artyst i przyjacielem, Waldemarem Kondratowskim, angauje si w tworzenie wsplnego projektu artystycznego. Ta kooperacja artystyczna symbolizuje ich synergiczn prac, gdzie obaj artyci cz siy, aby tworzy nowe i fascynujce dziea sztuki.`,\n    `Antonio Garca Mulet, wyrniajcy si swoj wyjtkow osobowoci oraz pozytywnym podejciem do ycia, zdoa zyska szerokie grono oddanych wielbicieli. Jego otwarto na nowe dowiadczenia i gboka ch przekazania swojej artystycznej wizji przyszym pokoleniom skoniy go do tworzenia dziea o nazwie \"Tcza\". To dzieo staje si manifestem jego idei tolerancji i rwnoci, stanowic wyjtkowy wkad w rozwijajcy si dyskurs kulturowy i artystyczny XXI wieku. Wsplny projekt z Mirell Kurek, ktra jest jego przyjacik i wsparciem, okaza si nie tylko artystycznym wyzwaniem, ale przede wszystkim silnym wizi czc ich dwie indywidualnoci. Mirella Kurek staa si aktywnym promotorem twrczoci Garci Muleta, co pozwolio na dotarcie do jeszcze szerszej publicznoci i przekazanie przesania artystycznego. To partnerstwo artystyczne, zrodzone z pasji do sztuki i wsplnego zaangaowania w promowanie wartoci, takich jak tolerancja i rwno, wpyno istotnie na rozwijajc si twrczo Garci Muleta, dowodzc, e sztuka moe peni rol nie tylko wyrazu artystycznego, ale take przekanika wanych przesa ksztatujcych nasz rzeczywisto.`,\n    `ycie Antonio Garca Muleta jest niczym obraz, ktrego kada kropka i pocignicie pdzla stanowi integraln cz gbszej opowieci. Jego surowa ekspresja, bogata symbolika i spojrzenie na wspczesno uczyniy go nie tylko wybitnym artyst, lecz take filozofem sztuki. Jego dziedzictwo bdzie kontynuowane przez kolejne pokolenia, inspirujc do refleksji i poszukiwania gbszego sensu w sztuce i yciu. Antonio Garca Mulet to nie tylko malarz, to mistyk, ktrego dziea staj si wezwaniem do odkrywania nieznanych obszarw sztuki i ludzkiej duszy.`\n];\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///./data/biographyData.tsx\n");

